import React from "react";

export default function ResumeSkills(props) {
  const elements = props.skill.map((el) => <li>{el}</li>);
  return (
    <div className="resume-skills">
      <h4>Skills</h4>
      <ul>{elements}</ul>
      <hr className="divider" />
    </div>
  );
}
